    <style type="text/css">
        body{
            display: flex;
            justify-content: space-evenly;
            font-family: arial;
        }
        label{
            min-width: 200px;
        }
        h3{
            margin-top: 0;
        }
        .l-col{
            max-height: 100vh;
            display: flex;
            flex-direction: column;
        }
        .estils{
            flex-grow: 1;
            overflow: auto;
            margin-top: 30px;
        }
        #mapa-catalunya #municipis path:hover{
            fill: teal;!important;
            fill-opacity: 1;
        }

        svg{
            width: 850px;
            height: 850px;
        }


        .stylesContainer{
            border: 2px solid black;
            padding: 10px;
            margin-bottom: 10px;
            border-radius: 10px;
        }
        .mapa-container{
            background-image: url("https://www.ecityclic.com/sites/all/themes/ecityclic/assets/skin/images/imatge-fons-administracio.jpg");
            background-size: cover;
            flex-grow: 1;
            display: flex;
            flex-direction: column;
            align-items: center;
            position: relative;
        }
        .mapa-container h1{
            color: white;
        }
        .mapa-container h1, .mapa-container svg{
            position: relative;
            z-index: 1;
        }
        .mapa-container:after{
            content: "";
            position: absolute;
            inset: 0;
            background: black;
            opacity: 0.5;
            backdrop-filter: blur(5px);
        }
    </style>

    <script type="text/javascript">
    //ESTILS
    var hexFormatChecker = function(color) {
        if (color.length > 0) {
            let regEx = /^[0-9a-fA-F]+$/;
            color = color.replace("#", "")
            let isHex = regEx.test(color);

            if (!isHex) {
                color = color.slice(0, -1);
            }

            if (color.length > 6) {
                color = color.slice(0, 6)
            }

            if (color.length > 0 && color.charAt(0) != "#") {
                color = "#" + color;
            }
        }
        return color
    };


    var colorChanged = function(valor, camp, objecte,classe) {
        $("#"+camp+"_"+objecte+"_"+classe)[0].value = valor;
        $("#"+camp+"Text_"+objecte+"_"+classe)[0].value = valor;
        inputChanged(valor, camp, objecte,classe)
    }


    var inputChanged = function(valor, camp, objecte, classe){
        if (classe == "active"){
            $("#"+objecte).find(".active").each(function() {
                this.setAttribute(camp,valor)
            });
        }
        else{
            $("#"+objecte).find("path:not('.active')").each(function() {
                this.setAttribute(camp,valor)
            });
        }
    }

    $(".stylesContainer input").change(function(){
        var input = this.id.split("_");
        var propietat = input[0];
        var objecte = input[1];
        var classe = input[2];

        switch (propietat){
            case "fill":
                colorChanged(this.value,"fill",objecte,classe);
                break;

            case "fillText":
                var color = this.value;
                color = hexFormatChecker(color);

                if (color.length == 7) {
                    this.value = color;
                    colorChanged(color,"fill",objecte,classe);
                }

                break;

            case "opacityfill":
                inputChanged(this.value/100,"fill-opacity",objecte,classe)
                break;
            case "stroke":
                    colorChanged(this.value,"stroke",objecte,classe);
                break;

            case "strokeText":
                var color = this.value;
                color = hexFormatChecker(color);

                if (color.length == 7) {
                    this.value = color;
                    colorChanged(color,"stroke",objecte,classe);
                }
                break;

            case "opacitystroke":
                inputChanged(this.value/100,"stroke-opacity",objecte,classe)
                break;

            case "gruix":
                inputChanged(this.value/10+"px","stroke-width",objecte,classe)
                break;
            case "dasharray":
                inputChanged(this.value, "stroke-dasharray",objecte,classe)
                break;
        }
    });
    //MECANIQUES

    var dropdownMunicipi = $("#municipi");
    var dropdownComarca = $("#comarca");
    var dropdownProvincia = $("#provincia");
    
    $("#municipi").change(function(e) {
         if (this.value == "reset"){
            dropdownMunicipi.val("reset");
            dropdownComarca.val("reset");
            dropdownProvincia.val("reset");
         }
         else{
            dropdownComarca.val(DetallsMunicipis[this.value].Comarca);
            dropdownProvincia.val(DetallsMunicipis[this.value].Provincia)
         }
           aplicarFiltres();
    });

    $("#comarca").change(function(e) {
        dropdownMunicipi.val("reset");
        if (this.value=="reset"){
            $(dropdownMunicipi).find("option").each(function(){
                $(this).show();
            })
        }
        else{
            var comarca = this.value;
            $(dropdownMunicipi).find("option").each(function(){
                if (this.value == "reset" || MunicipisPerComarques[comarca].includes(this.value)){
                    $(this).show();
                }
                else{
                    $(this).hide();
                }
            })
        }
        aplicarFiltres()
    });

    $("#provincia").change(function(e) {
        dropdownMunicipi.val("reset");
        dropdownComarca.val("reset");

        if (this.value=="reset"){
            $(dropdownMunicipi).find("option").each(function(){
                $(this).show();
            })
            $(dropdownComarca).find("option").each(function(){
                $(this).show();
            })
        }
        else{
            var provincia = this.value;
            var provinciesMostrar = []
            $(dropdownMunicipi).find("option").each(function(){
                if (this.value == "reset" || MunicipisPerProvincies[provincia].includes(this.value)){
                    $(this).show();
                    if (this.value != "reset" && !provinciesMostrar.includes(DetallsMunicipis[this.value].Comarca)){
                        provinciesMostrar.push(DetallsMunicipis[this.value].Comarca)
                    }
                }
                else{
                    $(this).hide();
                }
            })
            $(dropdownComarca).find("option").each(function(){
                if (this.value == "reset" || provinciesMostrar.includes(this.value)){
                    $(this).show();
                }
                else{
                    $(this).hide();
                }
            });
        }
        aplicarFiltres()
    });

    $("#municipis path").click(function() {
        dropdownMunicipi.val(this.id);
        $("#municipi").change();
    })

    function descarregarSVG() {
        // Obtenir el contingut de l'SVG com a cadena
        var svgString = new XMLSerializer().serializeToString(document.querySelector('svg'));

        var name = 'mapa-catalunya';
        var municipi = $("#municipi").val();
        if (municipi != "reset") name += '-'+municipi
        name += '.svg'

        // Crear un enllaç d'ancoratge per descarregar l'SVG
        var enllac = document.createElement('a');
        enllac.href = 'data:image/svg+xml,' + encodeURIComponent(svgString);
        enllac.download = name;
        enllac.target = '_blank'; // Opcional: obrir en una nova finestra

        // Simular un clic al botó d'enllaç per iniciar la descàrrega
        enllac.click();
    }

    $("#descarrega").click(function(){
        descarregarSVG();
    })

    $("#json-export").click(function(){
        var config = {};
        $(".stylesContainer input").each(function() {
            config[this.id] = this.value;
        });

        var jsonString = JSON.stringify(config, null, 2);

        var data, filename, link;
        var blob = new Blob([jsonString], { type: 'application/json' });
        filename = "config.json";
        
        if (window.navigator.msSaveOrOpenBlob) {
            window.navigator.msSaveBlob(blob, filename);
        } else {
            data = window.URL.createObjectURL(blob);
            link = document.createElement("a");
            link.href = data;
            link.download = filename;
            link.click();
        }
    })

    $("#json-import").change(function() {
        var input = this;
        if (this.files.length > 0) {
            // Obté el primer fitxer seleccionat
            var file = this.files[0];

            if (file.name.endsWith('.json')) {
                var reader = new FileReader();
                var str = "";
                reader.onload = function(e) {
                    str = e.target.result;
                    aplicarJSON(JSON.parse(str))
                    alert("S'ha aplicat el fitxer "+file.name+" correctament.")
                    input.value = '';
                };
                reader.readAsText(file);
            } else {
                alert("Si us plau, selecciona un fitxer JSON.");
            }

        }
    });

    var aplicarJSON = function (obj) {
        for (var key in obj) {
            $("#"+key).val(obj[key])
        }
        repintar();
    }

        $("#"+dropdownMunicipi.val()).addClass("active")
        repintar();
    }
    var refreshMapIds = function() {
        var selMun = $("#municipi")[0]
        var map = $("#mapa-catalunya")[0]
        $(map).find("path").each(function() {
            this.id = this.id.replaceAll("_", "-")
            this.classList = "";
            $(this).addClass(this.id)
        })

        $(selMun).find("option").each(function() {
            var valor = this.innerHTML;
            valor = valor.toLowerCase();
            valor = valor.replaceAll("'", "-");
            valor = valor.replaceAll(" ", "-");
            valor = valor.replaceAll(",", "-");
            valor = valor.replaceAll("ç", "c");
            valor = valor.replaceAll("á", "a");
            valor = valor.replaceAll("à", "a");
            valor = valor.replaceAll("ä", "a");
            valor = valor.replaceAll("è", "e");
            valor = valor.replaceAll("é", "e");
            valor = valor.replaceAll("ë", "e");
            valor = valor.replaceAll("í", "i");
            valor = valor.replaceAll("ì", "i");
            valor = valor.replaceAll("ï", "i");
            valor = valor.replaceAll("ó", "o");
            valor = valor.replaceAll("ò", "o");
            valor = valor.replaceAll("ö", "o");
            valor = valor.replaceAll("ú", "u");
            valor = valor.replaceAll("ù", "u");
            valor = valor.replaceAll("ü", "u");
            valor = valor.replaceAll("--", "-");

            var item = $(map).find("#" + valor);
            if (item[0] != undefined) {
                item[0].dataset['name'] = this.innerHTML;
                item[0].classList = "";
                $(item[0]).addClass(valor);
                item[0].id = this.value;
            }
        })
    }

    var inicialitzarDiccionaris = function () {
        iniciarMunicipisPerComarques();
        iniciarMunicipisPerProvincies();
        iniciarDetallsMunicipis();
    }

    var repintar = function () {
        var valors = {};
        $("input").each(function(){
            valors[this.id] = this.value;
        });

        $("#mapa-catalunya").find("g").each(function() {
            var objecte = this.id;
            if (objecte != "regio" || true){
                $(this).find("path").each(function(argument) {
                    var classe = "generica";
                    if ($(this).hasClass("active")){
                        classe = "active"
                    }
                    this.setAttribute("fill",valors["fill_"+objecte+"_"+classe]);
                    this.setAttribute("fill-opacity",valors["opacityfill_"+objecte+"_"+classe]/100);
                    this.setAttribute("stroke",valors["stroke_"+objecte+"_"+classe]);
                    this.setAttribute("stroke-opacity",valors["opacitystroke_"+objecte+"_"+classe]/100);
                    this.setAttribute("stroke-width",valors["gruix_"+objecte+"_"+classe]/10);
                    this.setAttribute("stroke-dasharray",valors["dasharray_"+objecte+"_"+classe]);
                })
            }
        })
    }

    inicialitzarDiccionaris();
    $("#municipi").change();
